import React, { Component } from "react";
import { BrowserRouter, Switch } from "react-router-dom";
import PublicRoute from "./PublicRoute";
import PrivateRoute from "./PrivateRoute";
import Games from "../component/Games";
import LandingPage from "../component/PhoneNumber";
import Chatting from "../component/Chatting";
import Settings from "../component/Settings";

class AppNavigation extends Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          {/* <PublicRoute /> */}
          <PublicRoute component={LandingPage} path='/' exact/>
          {/* <PrivateRoute component={Games} path="/games" exact />
          <PrivateRoute component={Chatting} path="/chatting" exact />
          <PrivateRoute component={Settings} path="/settings" exact /> */}

        </Switch>
      </BrowserRouter>
    );
  }
}

export default AppNavigation;
